const CompletedTasks = ({ MyTitle, TransitionGroup, CSSTransition, Task, ...props }) => {
  return (
    <div className='category__completedTasks'>
      <MyTitle {...props.categoryTitleStyles}>Completed tasks</MyTitle>

      <TransitionGroup
        className={
          props.darkMode ? 'completedTasksContainer darkMode' : 'completedTasksContainer'
        }>
        {props.tasksData
          .filter(task => task.completed)
          .map(completedTask => {
            const nodeRef = props.createRef(null)
            return (
              <CSSTransition
                key={completedTask.time}
                nodeRef={nodeRef}
                timeout={500}
                classNames='task'>
                <Task
                  time={completedTask.time}
                  currentTask={completedTask}
                  tabTitle={props.tabTitle}
                  completed={completedTask.completed}
                  deleteTask={props.deleteTask}
                  checkTask={props.checkTask}
                  timeLine={props.timeLine}
                  ref={nodeRef}>
                  {completedTask.task}
                </Task>
              </CSSTransition>
            )
          })}
      </TransitionGroup>
    </div>
  )
}

export default CompletedTasks
